import React,{useState} from 'react'

const Practice = () => {

    const [data, setData] = useState();

    const inputEvent = () =>{
        setData()
    }

    const onSubmits = (e) => {  
        e.preventDefault();
        alert('form submited');
    }


    return (
        <div>
        <form onSubmit = {onSubmits}>
        <input type="text"
         placeholder="enter your name"
        className="m-5" 
        value=""
        name=""
        onChange={inputEvent} />

        <input type="email"
                placeholder="Enter Your Email"
                className="m-5" 
                value=""
                name=""
                onChange={inputEvent} />

        <input type="number"
                placeholder="enter your number"
                className="m-5" 
                value=""
                name=""
                onChange={inputEvent} />

</form>
                    
        </div>
    )
}

export default Practice
